import React from "react";

export default function ContactList(props) {
    return (
        <div>
            if(this.)
            {
                props.list.map(contact => {
                    return (
                        <p>{contact.firstname} {contact.lastname} {contact.contact}</p>
                    )
                })
            }

        </div>
    )
}
